import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  return (
    <motion.div
      initial={{ x: '-100vw' }}
      animate={{ x: 0 }}
      exit={{ x: '100vw' }}
    >
      <h1>About</h1>
      <p>This is the about page.</p>
    </motion.div>
  );
};

export default About;
